import React from 'react';
import { Container, Card, Button, Row, Col } from 'react-bootstrap';

const WebExploitation = () => {
  return (
    <Container className="mt-5">
      <Row className="justify-content-center">
        <Col md={8}>
          <Card className="text-center shadow">
            <Card.Body>
              <Card.Title className="display-4">Web Exploitation</Card.Title>
              <Card.Text className="lead">
                Welcome to the Web Exploitation category! Here you will find challenges related to web security.
                <br />
                Test your skills in identifying vulnerabilities, exploiting them, and securing web applications.
              </Card.Text>
              <Button variant="primary" size="lg">Start Challenges</Button>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default WebExploitation;
